t.add("overview.title", "Overzicht", "HelpTextAdmin", "nl");
t.add("overview.text", "\n                   <p>Deze handleiding beschrijft de meeste functies binnen het CMS. Kies een pagina aan de linkerkant of klik op het vraagtegen rechtsboven tijdens het gebruiken van het CMS om de betreffende hulppagina te raadplegen.<\/p>\n\n                   <h2>Begrippen<\/h2>\n\n                   <p><strong>CMS<\/strong><br \/>\n                   <span style=\"line-height:1.6em\">Afkorting voor Content Management System<\/span><\/p>\n\n                   <p><strong>Pagina<\/strong><br \/>\n                   <span style=\"line-height:1.6em\">Een pagina toont bepaalde inhoud (content) in een bepaalde layout.<\/span><\/p>\n\n                   <p><strong>Interne URL<\/strong><br \/>\n                   <span style=\"line-height:1.6em\">Een pad naar een pagina die is aangemaakt binnen het CMS (bijv. &quot;\/over-ons\/geschiedenis&quot;)<\/span><\/p>\n\n                   <p><strong>Externe URL<\/strong><br \/>\n                   <span style=\"line-height:1.6em\">Een volledige URL naar een webpagina die niet is aangemaakt binnen het CMS (bijv. &ldquo;http:\/\/www.google.nl)<\/span><\/p>\n\n                   <p><strong>Menu-item&nbsp;<\/strong><br \/>\n                   <span style=\"line-height:1.6em\">Een link binnen een menu met een eigen naam en URL<\/span><\/p>\n\n                   <p><strong>Menu&nbsp;<\/strong><br \/>\n                   <span style=\"line-height:1.6em\">Een verzameling menu-items waarmee bezoekers kunnen navigeren door de website.<\/span><\/p>\n\n                   <p><strong>Media<\/strong><br \/>\n                   <span style=\"line-height:1.6em\">Mediabestanden die gebruikt worden in de content (bijv. afbeeldingen, videos)<\/span><\/p>\n\n                   <p><strong>Gebruiker<\/strong><br \/>\n                   <span style=\"line-height:1.6em\">Iemand met een gebruikersnaam en wachtwoord en toegang heeft tot het CMS of het beveiligde gedeelte binnen de website<\/span><\/p>\n\n                   <h2>Stappenplan: nieuwe pagina publiceren<\/h2>\n\n                   <p>Als u nog niet bekend bent met het CMS, dan volgt hieronder een simpel stappenplan waarmee u een pagina kunt aanmaken en deze in een menu zichtbaar kunt maken.<\/p>\n\n                   <ol>\n                   \t<li>Ga naar &quot;Pagina's&quot; en voeg een nieuwe pagina toe.<\/li>\n                   \t<li>Tijdens het toevoegen van de pagina klikt u op de &quot;+&quot; pictogrammen om content toe te voegen waar u wilt.<\/li>\n                   \t<li>Klik op de knop &quot;Publiceren&quot; om de pagina direct te publiceren (of vink &quot;Laten controleren&quot; aan om uw collega te informeren).<\/li>\n                   \t<li>Om de pagina zichtbaar te maken in het menu van de website, kunt u de pagina direct vanuit het wijzigscherm van de pagina toevoegen aan een menu. U kunt ook een nieuw menu-item aanmaken, het een naam geven en vervolgens koppelen aan uw nieuwe pagina.<\/li>\n                   <\/ol>\n\n                   <p>Gefeliciteerd! U heeft nu een nieuwe pagina gemaakt die bereikbaar is via de navigatie van uw website. Bekijk andere artikelen voor meer informatie.<\/p>\n                    \n                ", "HelpTextAdmin", "nl");
t.add("dashboard.title", "Dashboard", "HelpTextAdmin", "nl");
t.add("dashboard.text", "\n                    <p>Het dashboard is de eerste pagina die u te zien krijgt wanneer u ingelogd bent in het CMS. Afhankelijk van uw rol en rechten kunt u verschillende dingen zien op uw dashboard.<\/p>\n\n                    <h2>Informatieblokken<\/h2>\n\n                    <p><strong>Overzicht pagina's<\/strong><br \/>\n                    Overzicht van het aantal concepten, te controleren of reeds gepubliceerde pagina's<\/p>\n\n                    <p><strong>Concepten<\/strong><br \/>\n                    Een lijst met de laatst gewijzigde pagina's, welke nog niet gepubliceerd zijn<\/p>\n\n                    <p><strong>Te controleren<\/strong><br \/>\n                    Een lijst met pagina's die gecontroleerd moeten worden om vervolgens te publiceren<\/p>\n\n                    <p><strong>Momenteel online<\/strong><br \/>\n                    Toont alle gebruikers die op dit moment zijn ingelogd.<\/p>\n\n                    <p>Het dashboard kan uitgebreid worden met andere voor u relevante informatie. Wanneer u iets mist, neem dan contact op met uw webmaster om een functionaliteit toe te laten voegen.<\/p>\n                    \n                ", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.page.list.title", "Pagina-overzicht", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.page.list.text", "\n                    <p>Pagina's vormen de bouwstenen voor uw website. Op een pagina kunt u uw content toevoegen of wijzigen en de positie ervan binnen de layout aanpassen. Onder &quot;Pagina's&quot; binnen het CMS vind u een lijst van al uw pagina's. Boven de lijst kunt u uw selectie filteren en doorzoeken. Ook is er een duidelijke knop om een nieuwe pagina toe te voegen. Onderaan de lijst vind u een lijst om snel wijzigingen uit te voeren op meerdere pagina's.<\/p>\n\n                    <h2>Lijst met pagina's<\/h2>\n\n                    <p>De lijst met pagina's laat diverse informatie zien. Elke regel beschrijft een andere pagina. Hieronder worden de kolommen van links naar rechts toegelicht.<\/p>\n\n                    <p><strong>Selectievakjes<\/strong><br \/>\n                    U kunt \u00e9\u00e9n of meer <s>pagina's<\/s> selecteren door de selectievakjes aan te vinken. Met het eerste selectievakje bovenaan kunt u alle getoonde pagina's aanvinken. Nadat u de gewenste pagina's hebt geselecteerd kunt u een actie kiezen uit de lijst onderaan. Wanneer u op &quot;OK&quot; klikt wordt de actie uitgevoerd op de geselecteerde pagina's.<\/p>\n\n                    <p><strong>Naam<\/strong><br \/>\n                    Deze kolom toont de paginanaam. Als u op een naam klikt gaat u direct naar het wijzigscherm.<\/p>\n\n                    <p><strong>Status<\/strong><br \/>\n                    Rechts van de paginanaam ziet u de status van de pagina (Concept, Te controleren of Gepubliceerd).<\/p>\n\n                    <p><strong>URL<\/strong><br \/>\n                    Deze kolom toont de URL van de pagina. Deze URL bevat niet uw domeinnaam.<\/p>\n\n                    <p><strong>Knop Wijzigen<\/strong><br \/>\n                    De knop Wijzigen bevat een potlood-icoontje. Klik hierop om de content en de instellingen van de pagina te wijzigen.<\/p>\n\n                    <p><strong>Knop Verwijderen<\/strong><br \/>\n                    De knop Verwijderen heeft een prullenbak-icoontje. Klik hierop om een pagina te verwijderen die u niet langer wilt gebruiken.<\/p>\n\n                    <h2>Filter pagina's<\/h2>\n\n                    <p>U kunt de lijst met pagina's filteren met behulp van de gegeven velden. Nadat u de gewenste criteria hebt ingevuld klikt u op de knop &quot;Filteren&quot; om pagina's te vinden die voldoen aan uw criteria. Als u klikt op &quot;Filters leegmaken&quot; worden de filters gereset. Wanneer u klikt op &quot;Meer filteropties weergeven&quot; worden alle beschikbare filteropties getoond.<\/p>\n\n                    <p><strong>Taal<\/strong><br \/>\n                    Schakel tussen verschillende talen. U kunt pagina's in slechts \u00e9\u00e9n taal tegelijk bekijken.<\/p>\n\n                    <p><strong>Naam<\/strong><br \/>\n                    Zoek een specifieke pagina aan de hand van een bepaalde naam, of vind meerdere pagina's waarvan de zoekterm in de naam voorkomt.<\/p>\n\n                    <p><strong>URL<\/strong><br \/>\n                    Zoek een pagina aan de hand van (een gedeelte van) de URL.<\/p>\n\n                    <p><strong>Status<br \/>\n                    \u200b<\/strong>Zoek pagina's aan de hand van de status (Concept, Te controleren of Gepubliceerd).<\/p>\n\n                    <h2>Nieuwe pagina toevoegen<\/h2>\n\n                    <p>Om een nieuwe pagina toe te voegen klikt u op de knop &quot;+ Pagina toevoegen&quot;. Zie het betreffende helpartikel voor meer informatie.<\/p>\n                    \n                ", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.page.create.title", "Een pagina toevoegen", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.page.create.text", "\n                 <p>Begin door te klikken op op de knop &quot;+ Pagina toevoegen&quot; in de sectie &quot;Pagina's&quot; binnen het CMS. Alle velden gemarkeerd met een &quot;*&quot; zijn verplicht, de andere velden zijn optioneel. De volgende lijst beschrijft alle velden.<\/p>\n\n                 <h2>Paginavelden<\/h2>\n\n                 <p><strong>Taal<\/strong><br \/>\n                 Elke pagina behoort tot \u00e9\u00e9n taal. Op een later tijdstip kunt u deze pagina kopi\u00ebren naar een andere taal of koppelen aan een reeds bestaande pagina in een andere taal.<\/p>\n\n                 <p><strong>Naam<\/strong><br \/>\n                 De naam van de pagina is voor intern gebruik en is niet zichtbaar op de website.<\/p>\n\n                 <p><strong>Bovenliggende pagina<\/strong><br \/>\n                 Indien een andere pagina gerelateerd is aan deze pagina (bijv. Over ons en Geschiedenis), kan de ene pagina onder de andere geplaatst worden. Dit zal dan ook zichtbaar worden in de URL: bijv. http:\/\/wwww.site.nl\/over-ons\/geschiedenis in plaats van http:\/\/wwww.site.com\/geschiedenis.<\/p>\n\n                 <p><strong>URL<\/strong><br \/>\n                 Alleen het laatste gedeelte van de URL hoeft ingevoerd te worden. Als er een bovenliggende pagina is, wordt deze automatisch toegevoegd aan de URL. U kunt geen speciale tekens gebruiken in de URL; deze worden automatisch eruit gefilterd. Boven het veld kunt u zien hoe de URL eruit komt te zien.<\/p>\n\n                 <p><strong>Zichtbaarheid<\/strong><br \/>\n                 Een pagina kan publiekelijk zichtbaar zijn zodat iedereen het kan zien, of deze kan worden afgeschermd zodat de bezoeker ingelogd moet zijn om de pagina te zien.<\/p>\n\n                 <p><strong>Layout<\/strong><br \/>\n                 Kies de layout die het beste bij uw pagina past. Een selectie van een aantal vooraf gedefinieerde layouts worden getoond met een miniatuurweergave. De layout bepaalt waar content op de pagina geplaatst kan worden.<\/p>\n\n                 <p><strong>Meta-titel<\/strong><br \/>\n                 Deze titel wordt getoond in de browser en wordt gebruikt door zoekmachines.<\/p>\n\n                 <p><strong>Meta-keywords<\/strong><br \/>\n                 Keywords zijn niet zichtbaar op de pagina, maar komen in de broncode van de pagina. Deze worden door sommige zoekmachines verwerkt bij het indexeren van de pagina.<\/p>\n\n                 <p><strong>Meta-omschrijving<\/strong><br \/>\n                 Net als de keywords is de meta-description alleen zichtbaar in de broncode. Zoekmachines verwerken deze omschrijving bij het indexeren van de pagina.<\/p>\n\n                 <p>Zodra u het formulier opslaat, wordt de pagina opgeslagen en wordt u doorgestuurd naar het wijzigscherm.<\/p>\n                \n                ", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.page.edit.title", "Een pagina vullen", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.page.edit.text", "\n          <p>Het scherm bevat meerdere secties. Onder de paginatitel ziet u de contentsectie met \u00e9\u00e9n of meer layout-gebieden. Aan de rechterzijde vind u overige informatie en handelingen voor deze pagina.<\/p>\n\n          <h2>Contentsectie<\/h2>\n\n          <p>In de contentsectie onder de paginatitel ziet u een aantal layout-gebieden (bijv. header, main-content, column-left etc.). In elk gebied kunt u blokken met content plaatsen. Deze blokken kunnen bestaat uit teksten, fotoalbums of andere vooraf gedefinieerde blokken. Nieuwe blokken kunnen worden toegevoegd door op het + pictogram te klikken. Bestaande blokken kunt u verwijderen (prullenbak), wijzigen (potlood) of verplaatsen naar andere posities (pijlen).<\/p>\n\n          <h2>Status<\/h2>\n\n          <p>Een pagina kan nog in conceptvorm zijn of reeds gepubliceerd. De laatst gepubliceerde versie is wat de bezoekers van de website te zien krijgen, de conceptversie is alleen zichtbaar voor gebruikers binnen het CMS. Pagina's in conceptvorm kunnen ook gemarkeerd worden om te laten controleren, zodat uw collega's weten dat deze pagina klaar is om gepubliceerd te worden. LET OP, alleen gepubliceerde pagina's zijn zichtbaar voor de bezoekers van de website.<\/p>\n\n          <p><strong>Concept<\/strong><br \/>\n          Zodra een nieuwe pagina is aangemaakt of iets op de pagina wordt gewijzigd, verandert de status naar &quot;Concept&quot;. Als alle aanpassingen zijn doorgevoerd, kunt u de status wijzigen naar &quot;Te controleren&quot; of &quot;Gepubliceerd&quot;. Indien nodig, stel dat u bijvoorbeeld terug wilt naar de laatst &quot;gepubliceerde&quot; versie, kunt u klikken op &quot;Concept verwijderen&quot; aan de rechterzijde.<\/p>\n\n          <p><strong>Te controleren<\/strong><br \/>\n          Iemand heeft wijzigingen aangebracht aan de pagina en de pagina is klaar om gepubliceerd te worden (dit is echter nog niet gebeurd). Voordat de pagina wordt gepubliceerd moeten de wijzigingen worden gecontroleerd. Vink &quot;Laten controleren&quot; aan om dit aan iemand anders te laten weten. Uiteraard is dit niet verplicht, het helpt u echter uw werkstroom overzichtelijk te houden.<\/p>\n\n          <p><strong>Gepubliceerd<\/strong><br \/>\n          Als alle wijzigingen gecontroleerd zijn en correct blijken, kan de status veranderd worden in &quot;Gepubliceerd&quot;. Alle wijzigingen zijn nu zichtbaar voor de bezoekers.<\/p>\n\n          <h2>Vertalingen<\/h2>\n\n          <p>Indien deze pagina ook in een andere taal bestaat, kunt u een koppeling aanbrengen. Als alternatief kunt u de pagina kopi\u00ebren naar een andere taal voor een snelle start. Onder vertalingen kunt u alle koppelingen beheren.<\/p>\n\n          <h2>Menu-verbindingen<\/h2>\n\n          <p>Een pagina kan aanwezig zijn in verschillende menu's. U wilt bijvoorbeeld uw pagina &ldquo;Contact&rdquo; in zowel uw hoofdmenu als uw footer. Onder menu-verbindingen kunt u alle menu-items beheren en nieuwe aanmaken.<\/p>\n\n          <h2>Instellingen &amp; SEO<\/h2>\n\n          <p>Hier vind u dezelfde velden als bij het aanmaken van een nieuwe pagina. Door op het potlood-icoon te klikken, kunt u de paginanaam, URL, zichtbaarheid, layout en de meta-instellingen wijzigen.<\/p>\n                \n                ", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.menu_item.navigation.title", "Menu-overzicht", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.menu_item.navigation.text", "\n                    <p>Een menu biedt uw bezoekers de mogelijk om te navigeren door uw website. Elk menu kunt u beheren onder een apart tabblad. Onder het geselecteerde menu vind u alle opties en een lijst met menu-items. Deze lijst toont allerlei informatie over elk menu-item em biedt de mogelijkheid om elk menu-item te verplaatsen (andere volgorde), te wijzigen of te verwijderen. Boven de tabbladen kunt u de menu's filteren op taal.<\/p>\n\n                    <h2>Met menu's leren werken<\/h2>\n\n                    <p><strong>Menu's<\/strong><br \/>\n                    Een menu is een lijst met links naar pagina's. Een website kan meerdere menu's bevatten, bijvoorbeeld een &quot;hoofdmenu&quot; en een &quot;secundair menu&quot;. U kunt een nieuw menu toevoegen door op het &quot;+&quot; icoon te klikken rechts van de tabbladen (de meeste gebruikers hebben echter geen rechten om menu's toe te kunnen voegen of te verwijderen).<\/span><\/p>\n\n                    <p><strong>Menu-items<\/strong><br \/>\n                    Een menu-item bestaat uit een naam en een pagina of link (URL). Menu-items kunnen hierarchisch geordend worden, versleep de items om de gewenste structuur te cre\u00ebren. Hierbij kunt u gerust meerdere niveau's hanteren. De URL van de betreffende pagina verandert niet wanneer u een menu-item verplaatst naar een ander niveau in uw menustructuur.<\/p>\n\n                    <p><strong>Naam van een menu-item<\/strong><br \/>\n                    De naam van het menu-item kunt u helemaal zelf bepalen. Indien u wilt kunt u dezelfde naam gebruiken als de naam van de pagina waarnaar wordt verwezen, maar dit is niet verplicht. Kies een naam die past bij de inhoud, en gebruik termen die goed zijn voor zoekmachines.<\/p>\n\n                    <p><strong>Link van menu-item<\/strong><br \/>\n                    Een menu-item linkt naar een pagina of naar een eigen gedefinieerde externe\/interne URL. Verschillende menu-items kunnen verwijzen naar dezelfde pagina of dezelfde URL.<\/p>\n\n                    <p><strong>Taal van een menu<\/strong><br \/>\n                    Een menu behoort alleen tot de geselecteerde taal; elke taal heeft dus zijn eigen menu. Hierdoor kunt u desgewenst een afwijkende menuindeling gebruiken in elke taalsectie.<\/p>\n                ", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.menu_item.create.title", "Een menu-item toevoegen", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.menu_item.create.text", "\n                    <p>In het menu-overzicht vindt u de knop &quot;+ Item toevoegen&quot;. Wanneer u hierop klikt, kunt u een menu-item aanmaken binnen het geselecteerde menu.<\/p>\n\n                    <h2>Velden<\/h2>\n\n                    <p><strong>Naam<\/strong><br \/>\n                    De naam is verplicht en wordt getoond binnen uw menustructuur. Gebruik een naam die uw content het beste omschrijft.<\/p>\n\n                    <p><strong>Pagina<\/strong><br \/>\n                    De pagina is niet verplicht. U kunt een bestaande pagina kiezen, of handmatig een externe of interne URL invullen.<\/p>\n\n                    <p><strong>Externe URL<\/strong><br \/>\n                    De externe URL is niet verplicht. In plaats van een pagina te kiezen kunt u een volledige URL invullen, bijv. http:\/\/www.google.nl. U gebruikt dit om te verwijzen naar een andere website.<\/p>\n\n                    <p><strong>Interne URL<\/strong><br \/>\n                    De interne URL is niet verplicht. In plaats van een pagina te kiezen of een externe URL in te vullen, kunt u een interne URL invullen. Een interne URL bevat alles na het domein van uw website, bijv. \/over-ons\/geschiedenis. U dient relatieve links te gebruiken binnen uw eigen website.<\/p>\n\n                    <p><strong>+ Opties<\/strong><br \/>\n                    Klik op Opties voor de volgende mogelijkheden.<\/p>\n\n                    <p><strong>Zichtbaarheid<\/strong><br \/>\n                    Use the visibility setting to make the menu item public available or only in the secured area.<\/p>\n\n                    <p><strong>Doelvenster<\/strong><br \/>\n                    Define the target if you don&#39;t want that the page opens in the same window. There are multiple options to choose from.<\/p>\n\n                    <p><strong>CSS-klasse<\/strong><br \/>\n                    The link class your enter here will be added as a CSS styling option.<\/p>\n\n                    <p><strong>Link relatie<\/strong><br \/>\n                    This setting adds the &ldquo;rel&rdquo; attribute to your link. This can be useful when creating links which open a lightbox image gallery for example, or to trigger other javascript functionality.<\/p>\n\n                    <p><strong>Menu-item verbergen<\/strong><br \/>\n                    Indien u het menu-item wilt verbergen, maar toch wilt renderen. Dit wordt gebruikt in sommige situaties wanneer het bovenliggende menu-item als actief zichtbaar moet zijn.<\/p>\n                  ", "HelpTextAdmin", "nl");
t.add("sonata.media.admin.media.list.title", "Media-overzicht", "HelpTextAdmin", "nl");
t.add("sonata.media.admin.media.list.text", "\n                    <p>De mediasectie helpt u met het beheren van mediabestanden zoals afbeeldingen, video's, etc. Bovenaan de pagina kunt u de media filteren op basis van naam of tags. De verschillende tabbladen tonen de media context (zie hieronder), kies &quot;Standaard&quot; indien u niet weet wat u hier moet kiezen. Tenslotte volgt er een lijst met uw mediabestanden op basis van uw filters.<\/p>\n\n                    <h2>Mediacontext<\/h2>\n\n                    <p>Een context is een manier om verschillende type media te groeperen. Contexten zijn gedefinieerd in de configuratie van uw website; zo kan er ingesteld zijn welke type media zijn toegestaan in elke context en, in het geval van afbeeldingen, hoe de afbeeldingen uitgesneden moeten worden. Dit zorgt ervoor dat de juiste bestanden worden geupload en in het juiste formaat.<\/p>\n\n                    <h2>Mediatypen<\/h2>\n\n                    <p>Dit refereert naar de bestandsindeling of het type mediabestand, zoals:<\/p>\n\n                    <ul>\n                    \t<li>Afbeelding (.jpg, .png)<\/li>\n                    \t<li>PDF documenten (.pdf)<\/li>\n                    \t<li>Video (h246, mpeg)<\/li>\n                    \t<li>Audio (.mp3)<\/li>\n                    <\/ul>\n\n                    <p>Uw webmaster stelt deze voor u in.<\/p>\n                    \n                ", "HelpTextAdmin", "nl");
t.add("sonata.media.admin.gallery.list.title", "Albums", "HelpTextAdmin", "nl");
t.add("sonata.media.admin.gallery.list.text", "\n                    <p>De albums helpen u om een verzameling mediabestanden (meestal afbeeldingen) te presenteren op een pagina. U kunt eerst uw media uploaden en deze later selecteren tijdens het aanmaken van een album, of u upload uw bestanden tijdens het aanmaken van uw album.<\/p>\n\n                    <p>U kunt albums op een pagina plaatsen door deze als contentblok &ldquo;Fotoalbum&rdquo; toe te voegen.<\/p>\n\n                    <h2>Een album toevoegen<\/h2>\n\n                    <p>When you add a gallery you can also add media in the same step, so you don&#39;t have to go forth and back. The gallery consists of the following fields.<\/p>\n\n                    <p><strong>Enabled<\/strong><br \/>\n                    This flag can be used in your websites templates in order for the template to know if it should display the gallery or not. It is up to the template programmers as to how the field is used.<\/p>\n\n                    <p><strong>Name<\/strong><br \/>\n                    The name of the gallery. It will only be used internally, so you know which gallery you select for a page<\/p>\n\n                    <p><strong>Format<\/strong><br \/>\n                    Choose from different predefined formats. The formats define the size of the images and are predefined in your websites configuration. Your Webmaster is responsible for setting these up correctly at the beginning.<\/p>\n\n                    <p><strong>Media<br \/>\n                    \u200b<\/strong>Click &quot;+ Add new&quot; to add existing media or directly upload new media. You can even delete media from the gallery if necessary. You can come back any time to add or change media for a gallery.<\/p>\n                ", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.tag.list.title", "Media Tag", "HelpTextAdmin", "nl");
t.add("networking_init_cms.admin.tag.list.text", "\n                        <p>A media tag is a word or phrase, which you can freely create and associate to your media items. Media tags can then be used to filter all the media that is managed in the media library, you can then use the media tags to filter and find your way through large amounts of media quickly and easily<\/p>\n\n                        <p>Example tags might be &ldquo;holiday&rdquo; or &ldquo;portrait images&rdquo;. A media item can be associated with as many tags as you like.<\/p>\n                ", "HelpTextAdmin", "nl");
t.add("sonata.user.admin.user.list.title", "Gebruikersoverzicht", "HelpTextAdmin", "nl");
t.add("sonata.user.admin.user.list.text", "\n                    <p>Een gebruiker kan in het systeem inloggen met een gebruikersnaam\/e-mailadres en een wachtwoord. Gebruikers hebben binnen de website verschillende rechten, een beheerder mag bijvoorbeeld pagina's toevoegen en publiceren, maar andere gebruikers hebben alleen rechten om bepaalde pagina's te mogen bekijken. U kunt een gebruiker specifieke rollen (rechten) geven door deze toe te kennen aan \u00e9\u00e9n of meer gebruikersgroepen. Lees het helpartikel over gebruikersgroepen om meer te lezen over rechten.<\/p>\n\n                    <h2>Lijst met gebruikers<\/h2>\n\n                    <p>De lijst met gebruikers biedt een overzicht met informatie over alle gebruikers. Elke regel beschrijft een andere gebruiker. Onderstaande lijst beschrijft alle kolommen van links naar rechts.<\/p>\n\n                    <p><strong>Gebruikersnaam<\/strong><br \/>\n                    De gebruikersnaam van een gebruiker wordt gebruikt om in te loggen.<\/p>\n\n                    <p><strong>E-mailadres<\/strong><br \/>\n                    Het email-adres van de gebruiker wordt gebruikt wanneer diegene zijn of haar wachtwoord is vergeten.<\/p>\n\n                    <p><strong>Groepen<\/strong><br \/>\n                    Een lijst met groepen waartoe deze gebruiker behoort. Een groep bevat \u00e9\u00e9n of meer rollen, zodat het gemakkelijk is om de juiste rechten toe te kennen aan uw gebruikers.<\/p>\n\n                    <p><strong>Ingeschakeld<\/strong><br \/>\n                    Dit geeft aan of het account is ingeschakeld (geactiveerd) of niet. Alleen ingeschakelde accounts kunnen gebruikt worden om in te loggen.<\/p>\n\n                    <p><strong>Als gebruiker voordoen<\/strong><br \/>\n                    Met deze functie kunt u snel inloggen als de geselecteerde gebruiker, door slechts op het icoon te klikken. Dit is handig bij customer support omdat u vanaf dat moment precies hetzelfde ziet als de betreffende gebruiker. Om deze functie te mogen gebruiken heeft u wel bepaalde rechten nodig.<\/p>\n\n                    <p><strong>Knop Wijzigen<\/strong><br \/>\n                    De knop Wijzigen bevat een potlood-icoon. Klik hierop om de gebruiker aan te passen.<\/p>\n\n                    <p><strong>Knop Verwijderen<\/strong><br \/>\n                    De knop Verwijderen bevat een prullenbak-icoon. Klik hierop om een gebruiker volledig te verwijderen.<\/p>\n\n                    <h2>Filter gebruikers<\/h2>\n\n                    <p>U kunt de lijst met gebruikers filteren aan de hand van enkele criteria. Wanneer u deze criteria invult en op de knop &quot;Filteren&quot; klikt kunt u snel de gebruiker(s) vinden die u zoekt. Wanneer u klikt op &quot;Filters leegmaken&quot; worden de filters gereset. Wanneer u klikt op &quot;Meer filteropties&quot; worden alle mogelijke criteria getoond.<\/p>\n\n                    <p><strong>Gebruikersnaam<\/strong><br \/>\n                    De eerste filter zoekt op gebruikersnaam.<\/p>\n\n                    <p><strong>Geblokkeerd<\/strong><br \/>\n                    Hiermee kunt u geblokkeerde accounts vinden. Een gebruikersaccount kan geblokkeerd zijn, wat betekent dat ze het systeem niet kunnen gebruiken. Dit kan ge\u00efmplementeerd zijn om veiligheidsredenen.<\/p>\n\n                    <p><strong>E-mailadres<\/strong><br \/>\n                    Vul een e-mailadres of een gedeelte daarvan in om aan de hand daarvan de betreffende gebruikers te vinden.<\/p>\n\n                    <p><strong>Groepen<\/strong><br \/>\n                    Kies een groep om op te zoeken (of uit te sluiten).<\/p>\n\n                    <h2>Een nieuwe gebruiker toevoegen<\/h2>\n\n                    <p>Om een nieuwe gebruiker toe te voegen, klikt u op de knop &quot;+ Gebruiker toevoegen&quot;. U krijgt een formulier te zien met een aantal velden, waarvan alleen de volgende velden verplicht zijn.<\/p>\n\n                    <p><strong>Gebruikersnaam<\/strong><br \/>\n                    De gebruikersnaam waarmee de gebruiker kan inloggen.<\/p>\n\n                    <p><strong>E-mailadres<\/strong><br \/>\n                    Het e-mailadres van de gebruiker, deze wordt gebruikt voor contact en notificaties.<\/p>\n\n                    <p><strong>Wachtwoord<\/strong><br \/>\n                    Het wachtwoordveld is alleen verplicht bij het toevoegen van een nieuwe gebruiker (dit kan sterk afhangen van de configuratie van uw website).<\/p>\n\n                    <p>De gebruiker heeft een groot aantal optionele velden zoals groepen, rollen, persoonlijke gegevens, social media profielen en een aantal beveiligingsgerelateerde velden. Vul de gewenste velden in en laat de overige velden leeg.<\/p>\n                 ", "HelpTextAdmin", "nl");
t.add("sonata.user.admin.group.list.title", "Groepenoverzicht", "HelpTextAdmin", "nl");
t.add("sonata.user.admin.group.list.text", "\n                     <p>De gebruikersgroepen bieden de mogelijkheid om &quot;rollen&quot; (rechten) te beheren. Zoals genoemd in het gebruikersoverzicht kan een gebruiker tot \u00e9\u00e9n of meer groepen beheren.<\/p>\n\n                     <p>Een &quot;rol&quot; staat een gebruiker toe om bepaalde handelingen te mogen verrichten. Een gebruiker die bijvoorbeeld de rol &quot;ROLE_SONATA_ADMIN&quot; heeft, mag inloggen in het CMS van uw website en een gebruiker met de rol &quot;ROLE_NETWORKING_INIT_CMS_PAGE_ADMIN_PAGE_EDITOR&quot; mag pagina's aanmaken en zijn\/haar eigen pagina's wijzigen en verwijderen.<\/p>\n\n                     <p>Door een gebruikersgroep specifieke rollen toe te kennen behoeft u later alleen de juiste gebruikers in de juiste groepen te plaatsen, in plaats van alle afzonderlijke rollen toe te kennen aan elke gebruiker. Ook is het zo dat als u een rol wilt wijzigen, zal \u00e9\u00e9n wijziging in de gebruikersgroep invloed hebben op alle gebruikers binnen die groep.<\/p>\n\n                     <h2>Lijst met groepen<\/h2>\n\n                     <p><strong>Naam<\/strong><br \/>\n                     De naam van de gebruikersgroep, bijv. &quot;Redacteur&quot; of &quot;Tekstschrijver&quot;<\/p>\n\n                     <p><strong>Rollen<\/strong><br \/>\n                     Een lijst met de rollen die zijn toegekend aan deze gebruikersgroep. Vaak is deze lijst te lang om te worden weergegeven in het overzicht.<\/p>\n\n                     <h2>Filter groepen<\/h2>\n\n                     <p><strong>Naam<\/strong><br \/>\n                     Filter groepen op naam.<\/p>\n\n                     <h2>Een nieuwe gebruikersgroep toevoegen<\/h2>\n\n                     <p>Om een nieuwe gebruikersgroep toe te voegen, klikt u op de knop &quot;+ Groep toevoegen&quot;. Het formulier toont een tekstveld voor de naam, gevolgd door een lijst met selectievakjes voor alle beschikbare rollen (rechten).<\/p>\n\n                     <p>Indien u niet duidelijk is wat de rollen betekenen, kunt u uw webmaster raadplegen voor assistentie of het inrichten van de door u gewenste groep(en).<\/p>\n\n                 ", "HelpTextAdmin", "nl");
t.add("not_found.title", "Sorry, voor deze pagina is geen hulpartikel beschikbaar.", "HelpTextAdmin", "nl");
